import React from "react";
import linkedinLogo from "../resources/linkedin.png"
import instagramLogo from "../resources/instagram.png"
function Footer()
{
    return (
        <div className="Footer">
            <a href="https://www.linkedin.com/in/kaylea-gray-7277a21b6/"><img class="logo_medium" src={linkedinLogo}/></a>
            <a href="https://www.instagram.com/miss_kaylea_reads/"><img class="logo_small" src={instagramLogo}/></a>
        </div>
    );
}

export default Footer;
